module.exports.summaryDetailsByCategory = function (categoryName) {
    console.log(categoryName);
    var results = summaries.filter(function (item) {
        return item.category == categoryName;
    });
    return results;
};

module.exports.summaryDetailsByVendor = function (vendorName) {
    console.log(vendorName);
    var results = summaries.filter(function (item) {
        return item.vendor == vendorName;
    });
    return results;
};

module.exports.summaryDetailsByProduct = function (productName) {
    console.log(productName);
    var results = summaries.filter(function (item) {
        return item.product == productName;
    });
    return results;
};

module.exports.summaryDetails = function (vendorName, productName, categoryName) {
    console.log(productName);
    var results = summaries.filter(function (item) {
        if (item.vendor == vendorName) return true;
        if (item.product == productName) return true;
        if (item.category == categoryName) return true;
    });
    return results;
};